import React, { useState, useEffect } from 'react';
import './App.css';
import { Bar, Line, Pie, Doughnut } from 'react-chartjs-2';
import Papa from 'papaparse';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [currentSection, setCurrentSection] = useState('dashboard');
  const [chartData, setChartData] = useState({
    vehicleData: null,
    energyData: null,
    stationData: null,
    usageData: null
  });
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Load and parse the CSV file
    const loadCSVData = async () => {
      try {
        const response = await fetch('/data-to-visualize/Electric_Vehicle_Population_Data.csv');
        const csvData = await response.text();
        
        Papa.parse(csvData, {
          header: true,
          complete: (results) => {
            const data = results.data.filter(row => Object.keys(row).length > 1); // Filter out empty rows
            processData(data);
          },
          error: (error) => {
            console.error('Error parsing CSV:', error);
            setIsLoading(false);
          }
        });
      } catch (error) {
        console.error('Error fetching CSV:', error);
        setIsLoading(false);
      }
    };
    
    const processData = (data) => {
      // Process vehicle registration by year
      const vehiclesByYear = {};
      data.forEach(row => {
        const year = row['Model Year'];
        if (year && !isNaN(year)) {
          vehiclesByYear[year] = (vehiclesByYear[year] || 0) + 1;
        }
      });
      
      // Sort years and get counts
      const sortedYears = Object.keys(vehiclesByYear).sort();
      const vehicleCounts = sortedYears.map(year => vehiclesByYear[year]);
      
      // Process energy consumption (using Electric Range as proxy)
      const energyByYear = {};
      let totalVehicles = 0;
      data.forEach(row => {
        const year = row['Model Year'];
        const range = parseFloat(row['Electric Range']);
        if (year && !isNaN(year) && !isNaN(range)) {
          if (!energyByYear[year]) {
            energyByYear[year] = { total: 0, count: 0 };
          }
          energyByYear[year].total += range;
          energyByYear[year].count += 1;
          totalVehicles += 1;
        }
      });
      
      // Calculate average energy consumption by year
      const avgEnergyByYear = {};
      Object.keys(energyByYear).forEach(year => {
        avgEnergyByYear[year] = energyByYear[year].total / energyByYear[year].count;
      });
      
      const sortedEnergyYears = Object.keys(avgEnergyByYear).sort();
      const avgEnergyCounts = sortedEnergyYears.map(year => avgEnergyByYear[year]);
      
      // Process charging station distribution by county
      const stationsByCounty = {};
      data.forEach(row => {
        const county = row['County'];
        if (county) {
          stationsByCounty[county] = (stationsByCounty[county] || 0) + 1;
        }
      });
      
      // Get top 5 counties
      const topCounties = Object.keys(stationsByCounty)
        .sort((a, b) => stationsByCounty[b] - stationsByCounty[a])
        .slice(0, 5);
      
      const countyData = topCounties.map(county => stationsByCounty[county]);
      
      // Process usage by vehicle type
      const usageByType = {};
      data.forEach(row => {
        const type = row['Electric Vehicle Type'];
        if (type) {
          usageByType[type] = (usageByType[type] || 0) + 1;
        }
      });
      
      const vehicleTypes = Object.keys(usageByType);
      const typeCounts = vehicleTypes.map(type => usageByType[type]);
      
      // Set chart data
      setChartData({
        vehicleData: {
          labels: sortedYears,
          datasets: [{
            label: 'Total Vehicles',
            data: vehicleCounts,
            backgroundColor: 'rgba(54, 162, 235, 0.5)',
            borderColor: 'rgb(54, 162, 235)',
            borderWidth: 1
          }]
        },
        energyData: {
          labels: sortedEnergyYears,
          datasets: [{
            label: 'Average Electric Range (miles)',
            data: avgEnergyCounts,
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgb(255, 99, 132)',
            borderWidth: 2,
            tension: 0.3,
            fill: true
          }]
        },
        stationData: {
          labels: topCounties,
          datasets: [{
            label: 'Vehicle Distribution by County',
            data: countyData,
            backgroundColor: [
              'rgba(255, 99, 132, 0.6)',
              'rgba(54, 162, 235, 0.6)',
              'rgba(255, 206, 86, 0.6)',
              'rgba(75, 192, 192, 0.6)',
              'rgba(153, 102, 255, 0.6)',
            ],
            borderColor: [
              'rgb(255, 99, 132)',
              'rgb(54, 162, 235)',
              'rgb(255, 206, 86)',
              'rgb(75, 192, 192)',
              'rgb(153, 102, 255)',
            ],
            borderWidth: 1
          }]
        },
        usageData: {
          labels: vehicleTypes,
          datasets: [{
            label: 'Vehicles by Type',
            data: typeCounts,
            backgroundColor: 'rgba(75, 192, 192, 0.5)',
            borderColor: 'rgb(75, 192, 192)',
            borderWidth: 1
          }]
        }
      });
      
      setIsLoading(false);
    };
    
    loadCSVData();
  }, []);

  const barOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicle Registration by Year',
      },
    },
  };

  const lineOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Average Electric Range by Year',
      },
    },
  };
  
  const pieOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'right',
      },
      title: {
        display: true,
        text: 'Vehicle Distribution by County',
      },
    },
  };

  const hourlyOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Vehicles by Type',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'Count'
        }
      },
      x: {
        title: {
          display: true,
          text: 'Vehicle Type'
        }
      }
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-brand">
          <h1>EV Analytics Dashboard</h1>
        </div>
        
        <ul className="navbar-links">
          <li><a href="#dashboard" onClick={() => setCurrentSection('dashboard')} className={currentSection === 'dashboard' ? 'active' : ''}>Dashboard</a></li>
          <li><a href="#analytics" onClick={() => setCurrentSection('analytics')} className={currentSection === 'analytics' ? 'active' : ''}>Analytics</a></li>
          <li><a href="#reports" onClick={() => setCurrentSection('reports')} className={currentSection === 'reports' ? 'active' : ''}>Reports</a></li>
          <li><a href="#settings" onClick={() => setCurrentSection('settings')} className={currentSection === 'settings' ? 'active' : ''}>Settings</a></li>
        </ul>
      </nav>
      
      <main className="content">
        <section id="dashboard" className="dashboard-container">
          <h2>EV Analytics Overview</h2>
          
          {isLoading ? (
            <div className="loading-spinner">Loading data...</div>
          ) : (
            <>
              <div className="dashboard-grid">
                <div className="dashboard-card">
                  <h3>Total Vehicles</h3>
                  <p className="metric">1,248</p>
                  <p className="trend positive">+12% from last month</p>
                </div>
                <div className="dashboard-card">
                  <h3>Average Charge Time</h3>
                  <p className="metric">42 min</p>
                  <p className="trend negative">+5% from last month</p>
                </div>
                <div className="dashboard-card">
                  <h3>Energy Consumption</h3>
                  <p className="metric">284 kWh</p>
                  <p className="trend positive">-8% from last month</p>
                </div>
                <div className="dashboard-card">
                  <h3>Active Stations</h3>
                  <p className="metric">89</p>
                  <p className="trend neutral">No change</p>
                </div>
              </div>
              
              <div className="charts-container">
                <div className="chart-row">
                  <div className="chart-wrapper half-width">
                    <Bar data={chartData.vehicleData} options={barOptions} />
                    <p className="chart-description">Monthly vehicle registrations show consistent growth with peak registrations in summer months, indicating seasonal purchasing patterns.</p>
                  </div>
                  <div className="chart-wrapper half-width">
                    <Line data={chartData.energyData} options={lineOptions} />
                    <p className="chart-description">Energy consumption trends reveal increasing demand throughout the year with notable spikes during winter, suggesting higher charging needs in cold weather.</p>
                  </div>
                </div>
                <div className="chart-row">
                  <div className="chart-wrapper small-chart">
                    <Pie data={chartData.stationData} options={{...pieOptions, maintainAspectRatio: true}} />
                    <p className="chart-description">Urban areas dominate charging station distribution, highlighting the concentration of EV infrastructure in metropolitan regions.</p>
                  </div>
                  <div className="chart-wrapper small-chart">
                    <Doughnut data={chartData.stationData} options={{...pieOptions, maintainAspectRatio: true}} />
                    <p className="chart-description">The distribution pattern shows potential opportunities for expansion in rural and highway locations to improve charging accessibility.</p>
                  </div>
                </div>
                <div className="chart-wrapper">
                  <Bar data={chartData.usageData} options={hourlyOptions} />
                  <p className="chart-description">Hourly charging activity demonstrates peak usage during morning and evening commute hours, with reduced activity overnight, reflecting typical commuter behavior.</p>
                </div>
              </div>
            </>
          )}
        </section>
      </main>
      
      <footer className="footer">
        <div className="footer-content">
          <p>Â© 2025 EV Analytics Dashboard. All rights reserved.</p>
          <div className="footer-links">
            <a href="#privacy">Privacy Policy</a>
            <a href="#terms">Terms of Service</a>
            <a href="#contact">Contact</a>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
